import React from 'react';
import Square from './Square'
import './../App.css';

function generateRow(){
    var row = []
    for (let i = 0; i < 9; i++){
        row.push(<Square />);
    }
    return row;
}

function Board() {
  let row = generateRow();  
  return (
    <div>
        <ul>{row}</ul>
    </div>
  );
}

export default Board;
